     return (

    <div>
        <h1>{count}</h1>
        <button onClick={()=>count++}>up</button>
        <button onClick={()=>console.log(count)}>check</button>
        <h1>{i}</h1>
        <button onClick={()=>setI++}>up</button>
        <button onClick={()=>console.log(setI)}>check</button>
    </div>

     );
};
export default Conunter;
